import React from 'react';
import './fonts/rsufont/RSU_Regular.ttf'
import './fonts/rsufont/RSU_light.ttf'
import './fonts/rsufont/RSU_BOLD.ttf'
import './css/App.css';
import MyHome from './pages/MyHome.js';

function App() {
  return (
    <MyHome theme="theme_dark"></MyHome>
  );
}

export default App;
